import React from "react";
import "./Header.css";

const Header = () => {
  return (
    <div className="header">
      <div className="logo">House of Light</div>
      <ul className="nav_list">
        <li className="nav_item">Par mums</li>
        <li className="nav_item">Ēdienkarte</li>
        <li className="nav_item">Brančs</li>
        <li className="nav_item">Keiterings</li>
        <li className="nav_item">Kontakti</li>
      </ul>
      <div className="nav_burger"></div>
    </div>
  );
};

export default Header;
